import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

const Header = () => {
    return (
        <View style={styles.headreContainer}>
            <View style={styles.headerBox}>
                <Text >Hii Jackson</Text>
                <Text>Welcome to the Salonnz !!!</Text>
                <View style={styles.header_Box}>

                </View>
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    headreContainer: {
        position: 'absolute',
        width: '375px',
        height: '302px',
        left: 0,
        top: 0,
        backgroundColor: "#24C&D6",
    },
    headerBox: {
        width: '100vw',
        height: '10vh',
        backgroundColor: "blue",
    },
    header_Box: {
        width: '330px',
        height: '156px',
        left: '0px',
        top: '0px',
        backgroundColor: "#fff"
    }
})

export default Header;
